import './App.css';
import { Box } from '@mui/material';


import About from './pages/about';
import Navbar from './components/navbar';
function App() {
  return (

      <Box sx={{
        bgcolor: '#A594F9'
      }}>
    <Navbar/>


    <Box id="about"> <About/></Box>






    </Box>
  );
}

export default App;
